import { useState } from 'react';

export function InputField() {
    const [task, setTask] = useState("");

    function handleSubmit(e: any) {
        e.preventDefault();
    }
    return <form onSubmit={handleSubmit}>
        <input value={task} onChange={(e) => setTask(e.target.value)} type="text"/>
    </form>
}
